        public int LengthOfLongestSubstring(string s)
        {
            int ret = 0;
            //Dictionary<char, int> charMap = new Dictionary<char, int>();
            int[] charMap = new int[255];
            int counter = 0;
            for (int i = 0; i < s.Length; )
            {
                char iter = s[i];
                if (charMap[iter] == 0)
                {
                    charMap[iter] = i + 1;
                    counter++;
                    ++i;
                }
                else
                {
                    ret = Math.Max(ret, counter);
                    i = charMap[iter];
                    //charMap.Initialize();
                    Array.Clear(charMap, 0, charMap.Length);
                    counter = 0;
                }
            }
            ret = Math.Max(ret, counter);
            return ret;
        }
    }
